### Ethereum Blockchain Messenger Smart Contract

Below is a Solidity smart contract that fulfills the requirements of the blockchain messenger. This contract utilizes the `string` type for storing messages and `uint256` for counting updates.

```solidity
pragma solidity ^0.8.0;

contract BlockchainMessenger {
    // Mapping of message IDs to their respective messages
    mapping (uint256 => string) public messages;

    // Mapping of message IDs to their update counts
    mapping (uint256 => uint256) public updateCounts;

    // Mapping of message IDs to their authors
    mapping (uint256 => address) public authors;

    // Counter for generating unique message IDs
    uint256 public messageCounter = 0;

    // Function to save a message on the blockchain
    function sendMessage(string memory _message) public {
        // Increment the message counter
        messageCounter++;

        // Store the message with its ID
        messages[messageCounter] = _message;

        // Set the author of the message
        authors[messageCounter] = msg.sender;

        // Initialize the update count for the message
        updateCounts[messageCounter] = 0;
    }

    // Function to update a message
    function updateMessage(uint256 _id, string memory _newMessage) public {
        // Check if the message exists and the caller is the author
        require(messages[_id] != "", "Message does not exist.");
        require(msg.sender == authors[_id], "Only the author can update the message.");

        // Update the message
        messages[_id] = _newMessage;

        // Increment the update count
        updateCounts[_id]++;
    }

    // Function to get a message
    function getMessage(uint256 _id) public view returns (string memory) {
        // Check if the message exists
        require(messages[_id] != "", "Message does not exist.");

        // Return the message
        return messages[_id];
    }

    // Function to get the update count of a message
    function getUpdateCount(uint256 _id) public view returns (uint256) {
        // Return the update count
        return updateCounts[_id];
    }
}
```

### Explanation

- **`pragma solidity ^0.8.0;`**: This line specifies the version of the Solidity compiler to use. In this case, it's version 0.8.0 or higher.

- **`contract BlockchainMessenger { ... }`**: This defines a new contract named `BlockchainMessenger`.

- **`mapping (uint256 => string) public messages;`**: This line declares a mapping (a data structure similar to a dictionary in other languages) named `messages` that maps `uint256` (a 256-bit unsigned integer) keys to `string` values. This mapping is used to store messages on the blockchain.

- **`mapping (uint256 => uint256) public updateCounts;`**: This line declares another mapping named `updateCounts` that maps `uint256` keys to `uint256` values. This mapping is used to count how many times each message was updated.

- **`mapping (uint256 => address) public authors;`**: This line declares a mapping named `authors` that maps `uint256` keys to `address` values. This mapping is used to store the authors of each message.

